import React from "react";  
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './section.css'

const Section1 = ()=>{
    return(
        <div>
            <Row className='row10'>
                <Col className='col-md-5'></Col>
                <Col className='col-md-5 tc d-flex justify-content-center align-items-end'>
                    <img src='https://file.hbfile.net/global/en-us/static/img/5db6577.png' width={'250px'} />
                </Col>
            </Row>
        </div>
    )
}

export default Section1
